import './style.css'

function ProgrammerPage({ bugs, onDeleteBug }) {
  const handleDeleteBug = (bugId) => {
    onDeleteBug(bugId);
  };

  return (
    <div className='container'>
      <h2>Lista Bug-urilor</h2>
      <div>
      <ul>
        {bugs.map((bug) => (
          <li key={bug.id}>
            <div>
              <strong>{bug.title}</strong>
              <p>{bug.description}</p>
              <button onClick={() => handleDeleteBug(bug.id)}>Bug rezolvat</button>
            </div>
          </li>
        ))}
